  let typeImg = "";

if (video.TYPE === "Veg"){
  typeImg = "../img/Veg.png"
}


  return (

      <div className="ui column segment">
        <h4 className="ui header">{video.NAME}</h4>
        <p>{video.TYPE}</p>
        <p>Level: {video.LEVEL}</p>
        <img src={typeImg} ></img>
      </div>

  );
};

export default VideoItem;
